    ['TERRAIN_CHECK'] = 135, -- Request that the vehicle report terrain height at the given location. Used by GCS to check if vehicle has all terrain data needed for a mission.'
    ['TERRAIN_REPORT'] = 136, -- Response from a TERRAIN_CHECK request'
    ['SCALED_PRESSURE2'] = 137, -- Barometer readings for 2nd barometer'
    ['ATT_POS_MOCAP'] = 138, -- Motion capture attitude and position'
    ['SET_ACTUATOR_CONTROL_TARGET'] = 139, -- Set the vehicle attitude and body angular rates.'
    ['ACTUATOR_CONTROL_TARGET'] = 140, -- Set the vehicle attitude and body angular rates.'
    ['ALTITUDE'] = 141, -- The current system altitude.'
    ['RESOURCE_REQUEST'] = 142, -- The autopilot is requesting a resource (file, binary, other type of data)'
    ['SCALED_PRESSURE3'] = 143, -- Barometer readings for 3rd barometer'
    ['FOLLOW_TARGET'] = 144, -- current motion information from a designated system'
    ['CONTROL_SYSTEM_STATE'] = 146, -- The smoothed, monotonic system state used to feed the control loops of the system.'
    ['BATTERY_STATUS'] = 147, -- Battery information'
    ['AUTOPILOT_VERSION'] = 148, -- Version and capability of autopilot software'
    ['LANDING_TARGET'] = 149, -- The location of a landing area captured from a downward facing camera'
    ['ESTIMATOR_STATUS'] = 230, -- Estimator status message including flags, innovation test ratios and estimated accuracies. The flags message is an integer bitmask containing information on which EKF outputs are valid. See the ESTIMATOR_STATUS_FLAGS enum definition for further information. The innovaton test ratios show the magnitude of the sensor innovation divided by the innovation check threshold. Under normal operation the innovaton test ratios should be below 0.5 with occasional values up to 1.0. Values greater than 1.0 should be rare under normal operation and indicate that a measurement has been rejected by the filter. The user should be notified if an innovation test ratio greater than 1.0 is recorded. Notifications for values in the range between 0.5 and 1.0 should be optional and controllable by the user.'
    ['WIND_COV'] = 231, -- '
    ['GPS_INPUT'] = 232, -- GPS sensor input message.  This is a raw sensor value sent by the GPS. This is NOT the global position estimate of the sytem.'
    ['GPS_RTCM_DATA'] = 233, -- RTCM message for injecting into the onboard GPS (used for DGPS)'
    ['HIGH_LATENCY'] = 234, -- Message appropriate for high latency connections like Iridium'
    ['VIBRATION'] = 241, -- Vibration levels and accelerometer clipping'
    ['HOME_POSITION'] = 242, -- This message can be requested by sending the MAV_CMD_GET_HOME_POSITION command. The position the system will return to and land on. The position is set automatically by the system during the takeoff in case it was not explicitely set by the operator before or after. The position the system will return to and land on. The global and local positions encode the position in the respective coordinate frames, while the q parameter encodes the orientation of the surface. Under normal conditions it describes the heading and terrain slope, which can be used by the aircraft to adjust the approach. The approach 3D vector describes the point to which the system should fly in normal flight mode and then perform a landing sequence along the vector.'
    ['SET_HOME_POSITION'] = 243, -- The position the system will return to and land on. The position is set automatically by the system during the takeoff in case it was not explicitely set by the operator before or after. The global and local positions encode the position in the respective coordinate frames, while the q parameter encodes the orientation of the surface. Under normal conditions it describes the heading and terrain slope, which can be used by the aircraft to adjust the approach. The approach 3D vector describes the point to which the system should fly in normal flight mode and then perform a landing sequence along the vector.'
    ['MESSAGE_INTERVAL'] = 244, -- This interface replaces DATA_STREAM'
    ['EXTENDED_SYS_STATE'] = 245, -- Provides state for additional features'
    ['ADSB_VEHICLE'] = 246, -- The location and information of an ADSB vehicle'
    ['COLLISION'] = 247, -- Information about a potential collision'
    ['V2_EXTENSION'] = 248, -- Message implementing parts of the V2 payload specs in V1 frames for transitional support.'
    ['MEMORY_VECT'] = 249, -- Send raw controller memory. The use of this message is discouraged for normal packets, but a quite efficient way for testing new messages and getting experimental debug output.'
    ['DEBUG_VECT'] = 250, -- '
    ['NAMED_VALUE_FLOAT'] = 251, -- Send a key-value pair as float. The use of this message is discouraged for normal packets, but a quite efficient way for testing new messages and getting experimental debug output.'
    ['NAMED_VALUE_INT'] = 252, -- Send a key-value pair as integer. The use of this message is discouraged for normal packets, but a quite efficient way for testing new messages and getting experimental debug output.'
    ['STATUSTEXT'] = 253, -- Status text message. These messages are printed in yellow in the COMM console of QGroundControl. WARNING: They consume quite some bandwidth, so use only for important status and error messages. If implemented wisely, these messages are buffered on the MCU and sent only at a limited rate (e.g. 10 Hz).'
    ['DEBUG'] = 254, -- Send a debug value. The index is used to discriminate between values. These values show up in the plot of QGroundControl as DEBUG N.'
}

