MAV_STATE = {
    -- 
    ['MAV_STATE_UNINIT'] = 0 -- Uninitialized system, state is unknown.
    ['MAV_STATE_BOOT'] = 1 -- System is booting up.
    ['MAV_STATE_CALIBRATING'] = 2 -- System is calibrating and not flight-ready.
